import { Graph, FunctionExt } from '@antv/x6';
import { registry } from './registry';

Graph.Hook.prototype.getReactComponent = function (node) {
  var getReactComponent = this.options.getReactComponent;

  if (typeof getReactComponent === 'function') {
    var _ret = FunctionExt.call(getReactComponent, this.graph, node);

    if (_ret != null) {
      return _ret;
    }
  }

  var ret = node.getComponent();

  if (typeof ret === 'string') {
    var component = registry.get(ret);

    if (component == null) {
      return registry.onNotFound(ret);
    }

    ret = component;
  }

  return ret;
};
